import React from 'react';
import { Box, Typography } from '@mui/material';

const ProductsPage = () => {
  return (
    <Box sx={{ padding: 4 }}>
      <Typography variant="h4" gutterBottom>
        Наши продукты
      </Typography>
      <Typography variant="body1" paragraph>
        Мы предлагаем следующие продукты:
      </Typography>
      <ul>
        <li>Программное обеспечение для кассовых аппаратов</li>
        <li>Интерфейсы для интеграции с терминалами</li>
        <li>Мобильные приложения для управления кассой</li>
      </ul>
    </Box>
  );
};

export default ProductsPage;
